import './App.css';
import axios from 'axios'
import {Routes,Route,Link} from "react-router-dom"
import React,{useContext, useEffect,useState} from 'react';
import Home from './pages/home';
import New from './pages/New';
import Post from './pages/post';
import imgv from './img/th.jpg';
import frame from './img/frame.jpg';
import Cart from './cart/cart';
import Register from './loginS/Register';
import { AppContext, AppProvider } from './contex/AppContext';
import Login from './loginS/login';
import Bill from './cart/bill';


function App() {
  const [data,setData] = useState([]);
  const {dataContext,setDataContext,cartData,setCartData,dataLogIn,resInPost,setResInPost} = useContext(AppContext)


  useEffect(()=>{
    axios.get('http://localhost:5000/data/user')

    .then((res)=>{
      const getData = res.data;
     // console.log('----------',getData);
      setData(getData)
    },)

  },[])
 //console.log(data);

 //console.log(dataContext);
  const dataBaskets = dataContext.map(function(x,index){
    console.log(x);
   return x
  })

  function Ggg(){
     if(resInPost){
      return <Post></Post>
     }else{
      return<Login></Login>
     }
  };

  function Hhh(){
    if(dataLogIn){
     return ( <div>thanh toan thanh vong</div>)
    }else{
     return<Login></Login>
    }
 };

 function Bbb() {
  if(dataLogIn){
      return(
          <Bill></Bill>
          )
  }else{
      return( <Login></Login>)
  }

}

  return (

    <div className='App'>

       <div className='hearder'>

 <nav className='headerTop1'>
          <ul className='ul1'>
            <li>
              <Link to='/'><i className="fa-solid fa-house"></i>HOME</Link>
            </li>
            <li>
              <Link to='/new'>NEW</Link>
            </li>
            <li>
              <Link to='/post'>POST</Link>
            </li>
          </ul>
          <ul className='ul2'>
            <li>
              <a href='#'> <i className="fa-solid fa-bell"></i> Thông Báo</a>
            </li>
            <li>
              <a href='#'> <i className="fa-regular fa-circle-question"></i> Hỗ Trợ</a>
            </li>
            <li>
            <Link to='/register'>Dang Ky</Link>
            </li>
            <li>
            <Link to='/login'>Dang Nhap</Link>

            </li>
          </ul>
        </nav>

          <div className='hearderBotton'>
            <img src={imgv}></img>
            <div className='xxx'>
             <input type='text' placeholder='tim kiem'></input>
             <i className="fa-solid fa-magnifying-glass"></i>
            </div>
            <div className='cartBoss'>
            <a href='#'><i className="fa-solid fa-cart-shopping" onClick={()=>setCartData(true)}>{dataContext.length}</i></a>
            <div className='cartBoss1'>
               {cartData && <Cart></Cart>}
            </div>

            </div>
          </div>
      </div>
      <div className='content'>
        <div className='lerftSidebar'>
        <Routes>
        <Route path='/' element={<Home data={data}/>}/>

        <Route path='/new' element={<New />}/>
        <Route path='/bill' element={<Bbb></Bbb>}/>

        <Route path='/post' element={<Ggg></Ggg>}/>
        <Route path='/login' element={<Login/>}/>
        <Route path='/register' element={<Register/>}/>
       </Routes>
        </div >
        <div className='rightSidebar'>sight Sidebar</div>


    </div>


    </div>

  );
}

export default App;
